import React from 'react';
import { connect } from 'react-redux';
import {
  BrowserRouter as Router,
  Link
} from "react-router-dom";
import Form from '../../../components/form/form';
import Button from '../../../components/form/button';
import Message from '../../../components/message/index';
import Breadcrumb from '../../../components/breadcrumb/index';
import { report, dispatchItem } from '../../../actions/actions';
import { scrollToTop } from '../../../actions/utils';

class ReportDetail extends React.Component {
    constructor(props)
    {
        super(props)
    }

    render() {
        return (
            <div className="item-detail">
                <div className="details">
                    <div className="message">
                        <div className="label">
                            Mesaj
                        </div>
                        <div className="text">
                            {this.props.item.message}
                        </div>
                    </div>
                    <div className="statistics">
                        <div className="statistic-item">
                            <div className="label">
                                Gönderim Adedi
                            </div>
                            <div className="text">
                                {this.props.item.receiverCount}
                            </div>
                        </div>
                        <div className="statistic-item success">
                            <div className="label">
                                Başarılı
                            </div>
                            <div className="text">
                                {this.props.item.successCount}
                            </div>
                        </div>
                        <div className="statistic-item fail">
                            <div className="label">
                                Başarısız
                            </div>
                            <div className="text">
                                {this.props.item.failCount}
                            </div>
                        </div>
                        <div className={"statistic-item " + (this.props.item.waitingCount > 0 ? "waiting" : "")}>
                            <div className="label">
                                Bekliyor
                            </div>
                            <div className="text">
                                {this.props.item.waitingCount}
                            </div>
                        </div>
                    </div>
                </div>
                <a className="btn tertiary" href={process.env.REACT_APP_REPORT_DOWNLOAD_URL.replace("{groupId}", this.props.item.bmspGroupId)} target="_blank" title="Excel'e Aktar">
                    <span>Excel'e Aktar</span>
                </a>
            </div>
      );
    }
}

function mapStateToProps(state) {
    return {
        app: state.app 
    }
}

export default connect(mapStateToProps)(ReportDetail)
